const Navbar = () => {

  function getCookie(name) {
    const value = `; ${document.cookie}`;
    const parts = value.split(`; ${name}=`);
    if (parts.length === 2) return parts.pop().split(';').shift();
  }

  let cookie;

  const [adminLoginStatus,setAdminLoginStatus] = useState(false);

  const [isLoggedIn,setLoggedInStatus] = useState(false);

  const [showMediaIcons, setShowMediaIcons] = useState(false);

  //let cookie;
  useEffect(() => {
    cookie = getCookie("admin_cookie"); 
    if(cookie!=null){
      isLoggedIn = true;
      //alert("cookie there");
    }
    else{
      isLoggedIn = false;
    }    
  });




  if(isLoggedIn){
    return (
      <>
        <nav className="main-nav">
          {/* 1st logo part  */}
          <div className="logo">
            <h2>
              <span>C</span>ovid
              <span>Q</span>UARANTINE
            </h2>
          </div>

          {/* 2nd menu part  */}
          <div
            className={
              showMediaIcons ? "menu-link mobile-menu-link" : "menu-link"
            }>
            <ul>
              <li>
                <NavLink to="/">Home</NavLink>
              </li>
              {/* <li>
                <NavLink to="/login-doctor">Doctor Login</NavLink>
              </li>
              <li>
                <NavLink to="/login-admin">Admin Login</NavLink>
              </li>
              <li>
                <NavLink to="/add-doctor">Add Doctor</NavLink>
              </li>
              <li>
